import React from "react";
import "./Footer.css";

function Footer() {
    return (
        <div class="footer-container">
            <div class="footer-parent">
                <img src={require("../../../assets/Home/shape-bg.png")} alt="no internet connection" />
            </div>
        </div>
    );
}

export default Footer;
